Next we our going to implement the Parser trait. The basic idea is, given our input Check if it starts with a character from our category. If it does, return it and the rest of the input. If it does not, return an error. The difference with the Character parser is that String does not have a convenience method like starts_with that we can use. Instead we can use an iterator over the characters of our input. See below for details. impl<'a, F> Parser<'a, char> for Any<F> where F: Fn(char) -> bool + Sized { fn parse(&self, input: &'a str) -> Result<(char, &'a str), ParseError> { let character = input.chars().next(); match character { Some(c) => { if (self.predicate)(c) { Ok((c, &input[1..])) } else { Err(ParseError::ExpectingPredicate) } }, None => { Err(ParseError::EndOfInput) } } }
} We ask our input for an iterator over its characters. Match on the first character if it exists, and if it does, check to see if it is in the category. Notice that we introduced two new ParseErrors. #[derive(Debug, PartialEq)]
pub enum ParseError { GenericError, ExpectingCharacter(char), ExpectingPredicate, EndOfInput,
}

